import React, { useEffect, useState } from 'react';

function Home() {
  const [userEmail, setUserEmail] = useState('');

  useEffect(() => {
    fetchUserEmail();
  }, []);

  const fetchUserEmail = async () => {
    try {
      const response = await fetch('/api/isAuth', {
        method: 'GET',
        credentials: 'include',
      });

      if (response.ok) {
        const { email } = await response.json();
        setUserEmail(email);
      } else {
        throw new Error('Failed to fetch user email');
      }
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div id="dashboard">
      <h1>Dashboard</h1>
      {userEmail && <p>Welcome, {userEmail}!</p>}
    </div>
  );
}

export default Home;
